import React from 'react';
import { Wrapper, Header, H1, HorizontalScrollPage, Flexbox, SmallContainer} from '../components'

class WatchOrder extends React.Component {
	constructor( props ) {
		super(props); 
		this.state = {
			searchField: '',
		}
	}

	onSearchChange = (event) => {
		this.setState({searchField: event.target.value})
	}

	render() {

		return(
		    <Wrapper>
			    <Header>
			    	<H1 big>MCU OVERVIEW</H1>		    	
			    </Header>

			    <HorizontalScrollPage>
			    	<section>
			    		<H1>Phase 1</H1>
			    		<Flexbox height='auto' flexdirection='column' width='100%' background='green'> {/* The Whiteboard */}
			    			<Flexbox width='500px' background='gray' flexdirection='column'> {/* The Section */}

			    				<div>
			    				<SmallContainer width='180px' height='200px' background='black'> {/* The Card/s */}
			    				<H1>IRON MAN</H1>
			    				</SmallContainer>
			    				</div>

			    				<div>
			    				<SmallContainer width='180px' height='200px' background='yellow' > {/* The Card/s */}
			    				<H1>HULK</H1>
			    				</SmallContainer>
			    				</div>

			    				<h1>hey</h1>

			    			</Flexbox>

			    		</Flexbox>
			    	</section>
			    	<section>
			    		<H1>Phase 2</H1>
			    	</section>
			    	<section>
			    		<H1>Phase 3</H1>
			    	</section>	
			    	<section>
			    		<H1>Phase 4</H1>
			    	</section>	
			    	<section>
			    		<H1>Phase 5</H1>
			    	</section>			    				    			    				    	
			    </HorizontalScrollPage>
		    </Wrapper>
		);
	}

}

export default WatchOrder;
